selector_to_html = {"a[href=\"#case-theta-ref-t-textrm-step-t\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Case <span class=\"math notranslate nohighlight\">\\(\\theta_{ref}(t) = \\textrm{step}(t)\\)</span><a class=\"headerlink\" href=\"#case-theta-ref-t-textrm-step-t\" title=\"Link to this heading\">#</a></h4>", "a[href=\"#solutions-of-exercise-1-5\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 1.5<a class=\"headerlink\" href=\"#solutions-of-exercise-1-5\" title=\"Link to this heading\">#</a></h1><p>Assume that the DC motor described in <a class=\"reference internal\" href=\"exercise-1.1.html#ref-lec1-ex1\"><span class=\"std std-ref\">Exercise 1.1</span></a> is controlled by a <strong>Proportional (P)</strong> controller.</p>", "a[href=\"#question-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>We start by considering a proportional controller, <span class=\"math notranslate nohighlight\">\\(F(s) = K\\)</span>, where <strong><span class=\"math notranslate nohighlight\">\\(K\\)</span> is the proportional gain</strong>.</p><p>In this case, the closed loop transfer function is</p>", "a[href=\"#case-theta-ref-t-textrm-ramp-t\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Case <span class=\"math notranslate nohighlight\">\\(\\theta_{ref}(t) = \\textrm{ramp}(t)\\)</span><a class=\"headerlink\" href=\"#case-theta-ref-t-textrm-ramp-t\" title=\"Link to this heading\">#</a></h4>", "a[href=\"#case-delta-geq-0\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Case <span class=\"math notranslate nohighlight\">\\(\\Delta \\geq 0\\)</span><a class=\"headerlink\" href=\"#case-delta-geq-0\" title=\"Link to this heading\">#</a></h4><p>When <span class=\"math notranslate nohighlight\">\\(K &lt; \\frac{\\alpha^2}{4 k_o}\\)</span> the discriminant is positive, which means that there exist <strong>two real poles</strong>:</p>", "a[href=\"#question-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#question-2\" title=\"Link to this heading\">#</a></h3><p>Recalling that <span class=\"math notranslate nohighlight\">\\(\\Theta(s) = G_c(s) \\Theta_{ref}(s)\\)</span>, where <span class=\"math notranslate nohighlight\">\\(G_c(s)\\)</span> is the closed-loop transfer function,  since we have verified that <span class=\"math notranslate nohighlight\">\\(G_c(s) = \\frac{k_o K}{s^2 + \\alpha s + k_o K}\\)</span> is stable for any <span class=\"math notranslate nohighlight\">\\(K &gt; 0\\)</span>, we can apply the Final Value Theorem.</p><p>According to the Final Value Theorem,</p>", "a[href=\"#case-delta-0\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Case <span class=\"math notranslate nohighlight\">\\(\\Delta &lt; 0\\)</span><a class=\"headerlink\" href=\"#case-delta-0\" title=\"Link to this heading\">#</a></h4><p>When <span class=\"math notranslate nohighlight\">\\(K &gt; \\frac{\\alpha^2}{4 k_o}\\)</span> the discriminant is negative, which means that we have two complex conjugate poles.</p><p>In this case, it is easy to notice that</p>", "a[href=\"#solution-to-question-1\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Solution to Question 1<a class=\"headerlink\" href=\"#solution-to-question-1\" title=\"Link to this heading\">#</a></h4><p>The overall solution is given by the union of the solutions in the two cases:</p>", "a[href=\"#question-3\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 3<a class=\"headerlink\" href=\"#question-3\" title=\"Link to this heading\">#</a></h3><p>We now consider the case where we have a PI controller:</p>", "a[href=\"#assumption\"]": "<aside class=\"footnote brackets\" id=\"assumption\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id1\" role=\"doc-backlink\">1</a><span class=\"fn-bracket\">]</span></span>\n<p><span class=\"math notranslate nohighlight\">\\(k_p\\)</span> and <span class=\"math notranslate nohighlight\">\\(k_i\\)</span> can be designed either with the Routh criterion or with the rootlocus.</p>\n</aside>", "a[href=\"exercise-1.1.html#ref-lec1-ex1\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Exercise 1.1<a class=\"headerlink\" href=\"#exercise-1-1\" title=\"Link to this heading\">#</a></h1><p><a class=\"sd-badge sd-outline-primary sd-rounded-pill\" href=\"../search.html?q=%22Analysis%20%E2%88%99%20Linear%20dynamical%20systems%22\">Analysis \u2219 Linear dynamical systems</a></p>", "a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><p>As shown in <a class=\"reference internal\" href=\"exercise-1.1.html#ref-lec1-ex1\"><span class=\"std std-ref\">Exercise 1.1</span></a>, the transfer function of the motor is</p>"}
